    [],nt"num_tags": 35,nt"name": "fire-management-plan-wertheim-national-wildlife-refuge-1997",nt"isopen":
    false,nt"url": null,nt"notes": "The resource objectives of this unit are:
    1) Protect wildlife habitat by reducing the fuel loading of forest stands. 2) Maintain
    forest openings for wildlife by reducing woody plant invasions. 3) Enhance wildlife
    habitat through the use of fire. The objectives of this fire plan are 1} Reduce
    the ground fuels in 22.6 acres of forest by fifty percent. 2} eliminate the encroachment
    of woody vegetation by 50 percent in 1.4 acres of grassland. 3} enhance the forage
    and browse to wildlife of 24 acres of Refuge lands. 4} provide training and experience
    in prescribed fire to agency personnel.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
